// Updated MIT subject data with 5-year QS ranks, GPA & SAT cutoffs for all subjects

import React, { useState } from "react";
import { saveAs } from "file-saver";
import * as XLSX from "xlsx";

const universities = [
  {
    name: "Massachusetts Institute of Technology (MIT)",
    generalRank: 1,
    subjects: [
      "Computer Science",
      "Mathematics",
      "Engineering",
      "Physics",
      "Chemistry",
      "Biology",
      "Economics",
      "Architecture",
      "Linguistics",
      "Political Science",
      "Philosophy"
    ],
    fees: {
      international: 55000,
      domestic: 20000
    },
    intakes: ["January", "September"],
    applicationDeadlines: "March 15",
    courseLinks: {
      "Computer Science": "https://www.mit.edu/computer-science",
      "Mathematics": "https://www.mit.edu/mathematics",
      "Engineering": "https://www.mit.edu/engineering",
      "Physics": "https://www.mit.edu/physics",
      "Chemistry": "https://www.mit.edu/chemistry",
      "Biology": "https://www.mit.edu/biology",
      "Economics": "https://www.mit.edu/economics",
      "Architecture": "https://www.mit.edu/architecture",
      "Linguistics": "https://www.mit.edu/linguistics",
      "Political Science": "https://www.mit.edu/political-science",
      "Philosophy": "https://www.mit.edu/philosophy"
    },
    subjectData: {
      "Computer Science": [
        { year: 2025, qsRank: 1, gpaCutoff: 3.8, satCutoff: 1500 },
        { year: 2024, qsRank: 1, gpaCutoff: 3.8, satCutoff: 1490 },
        { year: 2023, qsRank: 1, gpaCutoff: 3.7, satCutoff: 1480 },
        { year: 2022, qsRank: 1, gpaCutoff: 3.7, satCutoff: 1470 },
        { year: 2021, qsRank: 1, gpaCutoff: 3.6, satCutoff: 1460 }
      ]
      // Add data for other subjects as needed
    }
  }
];

const App = () => {
  const [selectedUniversity, setSelectedUniversity] = useState(null);
  const [selectedSubject, setSelectedSubject] = useState("");
  const [studentType, setStudentType] = useState("international");

  const handleUniversityChange = (event) => {
    const uni = universities.find((u) => u.name === event.target.value);
    setSelectedUniversity(uni);
    setSelectedSubject("");
  };

  const handleSubjectChange = (event) => {
    setSelectedSubject(event.target.value);
  };

  const handleDownload = () => {
    if (!selectedUniversity || !selectedSubject) return;
    const data = selectedUniversity.subjectData[selectedSubject];
    const worksheet = XLSX.utils.json_to_sheet(data);
    const workbook = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(workbook, worksheet, "Rankings");
    const excelBuffer = XLSX.write(workbook, {
      bookType: "xlsx",
      type: "array"
    });
    const dataBlob = new Blob([excelBuffer], {
      type: "application/octet-stream"
    });
    saveAs(dataBlob, `${selectedSubject}_QS_Rankings.xlsx`);
  };

  return (
    <div style={{ fontFamily: "Arial", padding: 20 }}>
      <h1>QS World University Rankings</h1>

      <label>Select University: </label>
      <select onChange={handleUniversityChange} value={selectedUniversity?.name || ""}>
        <option value="" disabled>
          -- Choose a university --
        </option>
        {universities.map((u) => (
          <option key={u.name} value={u.name}>
            {u.name}
          </option>
        ))}
      </select>

      {selectedUniversity && (
        <>
          <h2>General QS Rank: {selectedUniversity.generalRank}</h2>
          <label>Select Subject: </label>
          <select onChange={handleSubjectChange} value={selectedSubject}>
            <option value="" disabled>
              -- Choose a subject --
            </option>
            {selectedUniversity.subjects.map((subject) => (
              <option key={subject} value={subject}>
                {subject}
              </option>
            ))}
          </select>

          <div>
            <label>Student Type: </label>
            <select value={studentType} onChange={(e) => setStudentType(e.target.value)}>
              <option value="international">International</option>
              <option value="domestic">Domestic</option>
            </select>
          </div>

          <div style={{ marginTop: 20 }}>
            <h3>Eligibility & Fees</h3>
            <p>
              <strong>Tuition Fees ({studentType}):</strong> ${selectedUniversity.fees[studentType]}
            </p>
            <p>
              <strong>Intake Months:</strong> {selectedUniversity.intakes.join(", ")}
            </p>
            <p>
              <strong>Application Deadline:</strong> {selectedUniversity.applicationDeadlines}
            </p>
            {selectedSubject && selectedUniversity.courseLinks[selectedSubject] && (
              <p>
                <strong>Course Link:</strong>{" "}
                <a href={selectedUniversity.courseLinks[selectedSubject]} target="_blank" rel="noreferrer">
                  {selectedUniversity.courseLinks[selectedSubject]}
                </a>
              </p>
            )}
          </div>

          {selectedSubject && (
            <div style={{ marginTop: 20 }}>
              <h3>{selectedSubject} - QS Rankings (Last 5 Years)</h3>
              <table border="1" cellPadding="5">
                <thead>
                  <tr>
                    <th>Year</th>
                    <th>QS Rank</th>
                    <th>GPA Cutoff</th>
                    <th>SAT Cutoff</th>
                  </tr>
                </thead>
                <tbody>
                  {selectedUniversity.subjectData[selectedSubject]?.map((entry) => (
                    <tr key={entry.year}>
                      <td>{entry.year}</td>
                      <td>{entry.qsRank}</td>
                      <td>{entry.gpaCutoff}</td>
                      <td>{entry.satCutoff}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
              <button style={{ marginTop: 10 }} onClick={handleDownload}>
                Download Excel
              </button>
            </div>
          )}
        </>
      )}
    </div>
  );
};

export default App;
